import "./sidebar.scss";
import { Contact } from "../Contact/Contact";
import { BoatAnimation } from "../BoatAnimation/BoatAnimation";

export const Sidebar = () => {
  return (
    <div className="sidebar">
      <Navbar />
      <BoatAnimation />
      <Contact />
    </div>
  );
};
